// Helper function to check if content matches any payment processor
export const findMatchingProcessor = (contentToCheck) => {
  for (const processor of Object.values(paymentProcessors)) {
    if (contentToCheck === processor.content) {
      return processor.name;
    }
  }
  return null;
};

// Helper function to get all processor names for display
export const getAllProcessorNames = () => {
  return Object.values(paymentProcessors).map((processor) => processor.name);
};
